import React, { useEffect, useState } from 'react'
import { PersonAPI } from './api/person.api'
import { PersonDto } from './api/dto/person.dto'

function API() {
  const [persons, setPersons] = useState<PersonDto[]>([])
  useEffect(() => {
    async function fetchAll() {
      const resp = await PersonAPI.getAll()

      setPersons(resp)
    }

    fetchAll()
  }, [])

  return (
    <div>
      {persons.map((person) => {
        return (
          <ul key={person.id}>
            <li>{person.firstname}</li>
          </ul>
        )
      })}
    </div>
  )
}

export default API
